import React, { useState, useEffect } from 'react';
import axios from 'axios';

function LineagePage() {
  const [lineage, setLineage] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:3000/api/lineage')  // Replace with your actual API
      .then(response => {
        setLineage(response.data);  // Assuming the API returns lineage data
      })
      .catch(error => {
        console.error('There was an error fetching lineage data!', error);
      });
  }, []);

  return (
    <div>
      <h2>Data Lineage</h2>
      <ul>
        {lineage.map((entry) => (
          <li key={entry.id}>{entry.description}</li>
        ))}
      </ul>
    </div>
  );
}

export default LineagePage;
